import timefrom functools import wrapsfrom utils.log import loggerdef time_consuming(func):	@wraps(func)	def wrapper(*args,**kwargs):		t1 = time.time()		data=func(*args,**kwargs)		t2 = time.time()		logger.debug('[{}]Training complete in {} real seconds'.format( getattr(func, '__name__'),t2 - t1))		return data	return wrapper